INSERT INTO migration_data."AD_Process_trad" (ad_process_id, value, name_de, name_trad, name_trl, description_de, description_trad, description_trl) VALUES (584736, 'updateOrderAndInvoiceID', 'Auftrag/Bestellung und Rechnung ermitteln', 'Auftrag/Bestellung und Rechnung ermitteln', 'Déterminez la commande / commande et la facture', 'The process works on unallocated payments. It sets the order referenced by the payment''s externalorderid. Then, it also sets an invoice if one is found for the set order. Also, it''s allocating the payment to an invoice if the order is a prepayment or if the order''s c_payment_id is the same as the payment we''re running the process and an invoice has been found. Also, the order must have a c_payment_id set.', 'The process works on unallocated payments. It sets the order referenced by the payment''s externalorderid. Then, it also sets an invoice if one is found for the set order. Also, it''s allocating the payment to an invoice if the order is a prepayment or if the order''s c_payment_id is the same as the payment we''re running the process and an invoice has been found. Also, the order must have a c_payment_id set.', 'Le processus fonctionne sur les paiements non alloués. Il définit la commande référencée par l''Externalorderside du paiement. Ensuite, il est donc défini sur la facturation si l''on est trouvé pour l''ordre défini. Ainsi, cela alloue le paiement à une facture si la commande est un remboursement ou si le C_Payment_id de la commande est le même que le paiement que nous exécutons le processus et une facture a été trouvée. Ainsi, l''ordre doit avoir un ensemble c_payment_id.');
